import React, { Component } from "react";
import { Card,Container,Row,Col } from 'react-bootstrap';

export default class stateReport extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            local_active_cases: ''
        };
    }
    componentDidMount() {
    fetch("https://hpb.health.gov.lk/api/get-current-statistical")
        .then(res => res.json())
        .then(
            (result) => {
                console.log(result)
                result.data.local_active_cases = this.local_active_cases;
                console.log('******',this.local_active_cases)
            },
        )

    }
    render() {
        const {local_active_cases} = this.state;
        return (
            <Container  className="card-wrapper" >
                <Row>
                    <Col>
                        <Card style={{ width: '18rem' }}>
                            <Card.Body>
                                <Card.Title>Card Title</Card.Title>
                                <Card.Subtitle className="mb-2 text-muted">Card Subtitle</Card.Subtitle>
                                <Card.Text>
                                    {local_active_cases}
                                </Card.Text>
                                <Card.Link href="#">Card Link</Card.Link>
                                <Card.Link href="#">Another Link</Card.Link>
                            </Card.Body>
                        </Card>
                    </Col>
                    <Col>
